import React, { Component } from "react";
//import IndexInfo from "./indexInfo";

const API =
  "https://npdpl9r340.execute-api.us-east-1.amazonaws.com/prod/marketdata/v1/index/HDAI/last";

class indexDetails extends Component {
  constructor(props) {
    super(props);

    this.state = {
      constituents: [],
      isLoading: false
    };
  }

  componentDidMount() {
    this.setState({ isLoading: true });

    fetch(API)
      .then(response => response.json())
      .then(data => this.setState({ constituents: data.constituents }));
  }

  //  state = {};
  render() {
    const { isLoading } = this.state;

    if (isLoading) {
      return <p>Loading... </p>;
    } else {
      return <p>its working bitches</p>;
    }
  }
}

export default indexDetails;
